import React from 'react';
import './Navigation.css';


const Navigation = () => {
	return (
		<div className='MainNav'>
  			<nav>
  				<h3>home</h3>
  				<h3>events</h3>
  				<h3>listen</h3>
  				<h3>store</h3>
  				<h3>contact</h3>
  			</nav>
  		</div>
	);
}

export default Navigation;
